let timeCount=0;const sleepResponse=function(e){setTimeout((function(){timeCount+=1e4,timeCount>3e5?self.postMessage("cancel"):verifyUpiResponseReceived(e)}),1e4)};function verifyUpiResponseReceived(e){fetch("/pgui/jsp/verifyUpiResponse",{method:"POST",body:JSON.stringify(e),headers:{"Content-Type":"application/json",Accept:"application/json"}}).then((e=>e.json())).then((s=>{if(null!=s){let n=s.transactionStatus;"Sent to Bank"==n||"Pending"==n?sleepResponse(e):self.postMessage(s)}else sleepResponse(e)})).catch((e=>{}))}self.onmessage=function(e){void 0!==e.data&&verifyUpiResponseReceived(e.data)};